  GetDurationInDays(fromDate, toDate): string {
    this.global.IsAPPLICATION_ONLITNE();
    var  dt1 = new Date(fromDate);
    var dt2 = new Date(toDate);
    var days = Math.floor((Date.UTC(dt2.getFullYear(), dt2.getMonth(), dt2.getDate()) - Date.UTC(dt1.getFullYear(), dt1.getMonth(), dt1.getDate()) ) /(1000 * 60 * 60 * 24)) +1;
  
   return days.toString();

  }

